import * as React from 'react';
import { useState } from 'react';
// eslint-disable-next-line
import { AppBar, Box, Button, Container, IconButton, Toolbar, Typography, Paper } from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import { Accordion, AccordionSummary, AccordionDetails } from '@mui/material';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';


function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  const handleLogIn = () => {
    setIsLoggedIn(true);
  };

  const handleLogOut = () => {
    setIsLoggedIn(false);
  };

  return (
    <>
      <AppBar position="fixed">
        <Container fixed>
          <Toolbar>
            <IconButton edge="start" color="inherit" aria-label="menu">
              <MenuIcon />
            </IconButton>
            <Typography variant="h6">Nomad's Odyssey</Typography>
            <Box sx={{ flexGrow: 1 }} />
            {isLoggedIn ? (
              <Button color="inherit" variant="outlined" onClick={handleLogOut}>
                Log Out
              </Button>
            ) : (
              <>
                <Button color="inherit" variant="outlined" sx={{ mr: 3 }} onClick={handleLogIn}>
                  Log In
                </Button>
                <Button color="secondary" variant="contained">
                  Sign Up
                </Button>
              </>
            )}
          </Toolbar>
        </Container>
      </AppBar>
      <Box sx={{
  backgroundImage: 'url(https://vsegda-pomnim.com/uploads/posts/2022-04/1650914206_25-vsegda-pomnim-com-p-almati-vid-na-gori-foto-27.jpg)',
  height: '50vh',
  backgroundSize: 'cover',
  display: 'flex',
  alignItems: 'center'
}}>
  <Container fixed>
    <Typography variant="h4" sx={{ fontWeight: 'light', color: 'rgba(252, 101, 232, 1)', fontFamily: 'Montserrat, sans-serif', fontStyle: 'oblique', textShadow: '2px 2px 4px rgba(0, 0, 0, 0.3)' }}>
      Nomad's Odyssey
    </Typography>
    <Typography variant="h4" sx={{ fontWeight: 'light', color: 'rgba(252, 101, 232, 1)', fontFamily: 'Montserrat, sans-serif', fontStyle: 'oblique', textShadow: '2px 2px 4px rgba(0, 0, 0, 0.3)' }}>
      Откройте для себя мир приключений и неизведанных уголков Казахстана с Nomad's Odyssey!
    </Typography>
  </Container>
</Box>
<Box sx={{ p: 3 }}>
        <Typography variant="h4">Frequently Asked Questions</Typography>
        <Accordion>
          <AccordionSummary expandIcon={<ExpandMoreIcon />} aria-controls="panel1a-content" id="panel1a-header">
            <Typography variant="h5">What is Nomad's Odyssey?</Typography>
          </AccordionSummary>
          <Typography variant="body1" sx={{ p: 2 }}>
            Nomad's Odyssey is a travel website that helps you discover the adventure and beauty of Kazakhstan.
          </Typography>
        </Accordion>
        <Accordion>
          <AccordionSummary expandIcon={<ExpandMoreIcon />} aria-controls="panel2a-content" id="panel2a-header">
            <Typography variant="h5">How do I book a trip?</Typography>
          </AccordionSummary>
          <Typography variant="body1" sx={{ p: 2 }}>
            You can book a trip by clicking the "Book Now" button on the trip page and filling out the booking form.
          </Typography>
        </Accordion>
        {/* add more Accordion components for each question/answer pair */}
      </Box>

    </>
  );
}

export default App;
